window.bookSummaryJSON = "<p>\"Deep, dark, and sensual.\" (<i>USA Today</i> best-selling author Alta Hensley)</p> <p>I was hired to apprehend a monster - a dom who'd been sentenced to life for killing his submissive. I've seen what he's capable of, and the images will haunt me forever. I swore I'd stop at nothing to put him behind bars.</p> <p>But then our plane back to the States crashes. We are the only two survivors. And the monster will make me wish I'd died along with the rest of them....</p> <p>Please note: This is a dark romance that includes kinky, sexual content and dubious consent.</p>"; 
